import { UserContext } from './UserContext'

export const HomeScreen = () => {

    const userContext = useContext(UserContext);

    return (
        <div>
            <h1>Home Screen</h1>
            <hr />

            <pre>
                {JSON.stringify(userContext, null, 3)}
            </pre>
        </div>
    )
}
